// ../charts/ActivityChart/ActivityChart.js

import React from 'react';
import { LineChart, Line, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import XAxisWrapper from '../../Axis/XAxisWrapper' ;
import YAxisWrapper from '../../Axis/YAxisWrapper';

const ActivityChart = ({ data }) => {
  return (
    <ResponsiveContainer width="100%" height={400}>
      <LineChart data={data}>
        <CartesianGrid strokeDasharray="3 3" />
        <XAxisWrapper dataKey="date" label="Date" />
        <YAxisWrapper label="Sessions" />
        <Tooltip />
        <Legend />
        <Line type="monotone" dataKey="sessions" stroke="#8884d8" activeDot={{ r: 8 }} />
      </LineChart>
    </ResponsiveContainer>
  );
};

export default ActivityChart;
